import React from "react";
import { Link } from "react-router-dom";

const User = ({ posts }) => {
  return (
    <div>
      (user, key) => (
      <div key={key}>
        <Link
          className="dropdown-item"
          to={{
            pathname: `/update-user/${user._id}`,
          }}
        >
          <div className="text-center "> User</div>
        </Link>
      </div>
      )
    </div>
  );
};

export default User;
